import { Component } from 'react';
import './App.css';
import SimpleComponent from './Components/SimpleComponent';
import Greeting from './Components/Greeting';
import NameList from './Components/NameList';

class App extends Component {

  render() {
    return (
      <div className='App'>
        <SimpleComponent />
        <Greeting />
        <NameList />

      </div>
    )
  }
}

export default App;
